                'hasildiagnosa' => '{"penyakit":["Whitehead","Blackhead"],"keterangan":["Whitehead\\/Komedo Putih : Saat pori-pori kulit mengalami sumbatan, baik karena sel kulit mati atau sebum, komedo putih pun terbentuk. Namun komedo putih biasanya ada di bawah permukaan kulit dengan bagian atas pori menutup tapi tetap nampak, jadi seperti ada benjolan kecil menonjol","Blackhead\\/Komedo Hitam : Terjadi di saat pori-pori tersumbat oleh produksi minyak berlebih\\/sebum serta sel kulit mati. Hanya saja, bagian atas pori terbuka sebagian sehingga warna hitamnya nampak pada permukaan kulit dan disebut dengan komedo hitam."],"saran":["Untuk penanganan whitehead yaitu dengan melakukan eksfoliasi atau menggunakan produk wajah yang mengandung benzoic peroxide, lakukan selama 2x atau 1x seminggu.","Untuk penanganan blackhead yaitu dengan menggunakan scrub bisa dalam bentuk facial wash\\/masker, lakukan selama 2x atau 1x seminggu."],"bobot":39.90422984836407}',
