                'hasildiagnosa' => '{"penyakit":["Pustula","Nodula"],"keterangan":["Pustula : Ketika dinding sekitar pori kulit rusak, pembentukan pustula terjadi di mana benjolan ini nampak keluar dari kulit dengan warnanya yang kemerahan. Di pucuk atau puncak dari benjolan akan kelihatan warnanya putih atau kuning di mana itu sebenarnya adalah nanah.","Nodula : Pori-pori mengalami sumbatan yang disertai bengkak tanda iritasi. Hanya saja, keberadaan nodula ada di bawah kulit dan jauh lebih dalam."],"saran":["Untuk penanganan pustula yaitu dengan menggunakan skincare yang mengandung salicylic acid \\/ sulfur. Hindari makanan yang tinggi lemak dan yang manis-manis.","Untuk penanganan nodul yaitu dengan konsultasi kedokter karena perawatannya butuh yang intensif sebab jenis ini sudah meradang diluar dan juga dipermukaan kulit jadi membutuhkan perawatan yang ekstra, tetapi bisa juga menggunakan perawatan-perawatan wajah atau skincare-skincare yang mengandung salicylic acid, niacinamide."],"bobot":59.90400000000001}',
