                'hasildiagnosa' => '{"penyakit":["Nodula","Kista"],"keterangan":["Nodula : Pori-pori mengalami sumbatan yang disertai bengkak tanda iritasi. Hanya saja, keberadaan nodula ada di bawah kulit dan jauh lebih dalam.","Kista : Pori-pori yang mengalami sumbatan oleh sel kulit mati, sebum maupun bakteri dapat menyebabkan jerawat kistik. Dibandingkan nodula, sumbatan terjadi lebih jauh di bawah permukaan kulit. Hal ini ditandai dengan benjolan putih atau merah yang cukup besar dan akan sangat sakit ketika disentuh."],"saran":["Untuk penanganan nodul yaitu dengan konsultasi kedokter karena perawatannya butuh yang intensif sebab jenis ini sudah meradang diluar dan juga dipermukaan kulit jadi membutuhkan perawatan yang ekstra, tetapi bisa juga menggunakan perawatan-perawatan wajah atau skincare-skincare yang mengandung salicylic acid, niacinamide.","Kista : Segera bicara dengan dokter spesialis kulit. Penggunaan obat jerawat yang dijual bebas biasanya kurang ampuh dalam mengatasi penyakit ini."],"bobot":76.00000000000003}',
